import React from 'react';


const NavBar = ({RouteChange}) => {
    return(
        <nav className="dt w-100 border-box pa3 ph5-ns bg-light-blue ">
            <a className="dtc v-mid mid-gray link dim w-25" href="#" title="Home">
                <img src="https://library.lapeer.org/children/images/mypc-website-icon-2-books.png/@@images/62152f98-be65-43be-8fe9-e7dcb97f5646.png" onClick={() => RouteChange('')} className="dib w2 h2 br-100" alt="Site Name"/>
            </a>
            <div className="dtc v-mid w-75 tr">
                <p className="link dim dark-gray f6 f5-ns dib mr3 mr4-ns pointer"  onClick={() => RouteChange('addBook')}>Add new Book</p>
                <p className="link dim dark-gray f6 f5-ns dib mr3 mr4-ns" title="Store" onClick={() => RouteChange('MyBooks')}>My books</p>
                <a className="link dim dark-gray f6 f5-ns dib" href="#" title="Contact" onClick={() => RouteChange('ToRead')}>Books to read</a>
            </div>
        </nav>
    );
}

export default NavBar;
